import React from 'react';


function Todolist(props) {
    return (
       <div className='card'>
            <div className='card__group'>
                <div className='card__item width22'>
                    <h3 className='mb-8'>Title: Task1</h3>
                    <p className='mb-8'>Creator: Author</p>
                    <p className='text mb-8 new'>Status: New</p>
                    <h3 className='title mb-8'>Desscription</h3>
                    <p>This a task This a task This a task This a task..</p>
                    <button className='btn'>Start</button>
                </div> 
            </div>
       </div>
    );
}

export default Todolist;
